import React from 'react';
import {HomeButton} from '../components/buttons/Buttons';
import { ActivityName, ActivityDescription, StarRating, UploadImage, UserDescription } from '../components/input/Input';
import Container from 'react-bootstrap/Container';
import { ActivityCard } from '../components/card/card';
// import Row from 'react-bootstrap/Row';
// import Col from 'react-bootstrap/Col';

const MakePost = () => {

    const submitInfo = (e) => {
        e.preventDefault();
        alert('submitted;')
    }

    return (
        <Container fluid className='text-center'>
            <h1>POST PAGE</h1>
            <HomeButton />
            <form onSubmit={submitInfo}>
                <ActivityName />
                <ActivityDescription />
                <StarRating />
                <UploadImage />
                <UserDescription />
                <button type='submit'>Create Post</button>
            </form>
        </Container>
    )
}

export default MakePost;
